import React from 'react'
import Card from '../Components/Card'
import { useCharStates } from '../Context/Context'

const Favs = () => {

  const {favs} = useCharStates()

  return (
    <div>
      {favs.map(fav => <Card item={fav} key={fav.id}/>)}
    </div>
  )
}

export default Favs
